    [],nt"revision_timestamp": "2016-10-15T16:36:18.088902",nt"name": "blackwater-national-wildlife-refuge-glen-l-martin-nwr-susquehanna-nwr-annual-narrative-rep-52432",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Blackwater
    National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, funding, safety, and technical assistance is given.
    Habitat management is also covered; subjects include wetlands, forests, croplands,
    fire management, and pest control. The wildlife section of the report discusses
    endangered and threatened species, migratory birds, game mammals, surplus animal
    disposal, animal control, marking and bird banding, and disease prevention and control.
    The public uses of the Refuge described in this report include information and interpretation,
    outdoor classrooms, recreational uses, and law enforcement. The equipment and facilities
    section of the report provides information about major maintenance, equipment replacement,
    communication systems, and energy conservation. Cooperative programs and items of
    interest are provided at the end. Photographs and brief narrative reports for Glen
    L. Martin National Wildlife Refuge and Susquehanna National Wildlife Refuge are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
